   RTDIAG_NEWBITFIELD (pctxt, "optional bit");

   ret = rtxEncBit (pctxt, (OSBOOL) rtx3GPPGetPatternBit(pctxt, (1 == pvalue->m.component_7Present) ? 0xD4 : 0x2B ));
   if (ret < 0) return LOG_RTERR (pctxt, ret);

   RTDIAG_SETBITFLDCOUNT (pctxt);

   if (pvalue->m.component_7Present) {

      ret = NASEnc_TS44018IE_SI6_Rest_Octets_component_7 (pctxt, &pvalue->
         component_7);
      if (ret < 0) return LOG_RTERR (pctxt, ret);

   }
   RTXCTXTPOPELEMNAME (pctxt);

   /* encode random-bit-stream */

   RTXCTXTPUSHELEMNAME (pctxt, "random-bit-stream");
   RTDIAG_NEWBITFIELD (pctxt, "optional bit");

   ret = rtxEncBit (pctxt, (OSBOOL) rtx3GPPGetPatternBit(pctxt, (1 == pvalue->m.random_bit_streamPresent) ? 0xD4 : 0x2B ));
   if (ret < 0) return LOG_RTERR (pctxt, ret);

